import React, { useState } from 'react';
import { Button, TextField, FormControl, InputLabel, Select, MenuItem, Box } from '@mui/material';

const AddProgramForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    organization: '',
    field: '',
    eligibility: { age: '', year: '' },
    type: '',
    cost: '',
    location: '',
    virtual: '',
    startDate: '',
    endDate: '',
    website: '',
    applicationDeadline: '',
    description: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // API call to add the new program
  };

  return (
    <form onSubmit={handleSubmit}>
      <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
        <TextField name="name" label="Name" required onChange={handleChange} />
        <TextField name="organization" label="Organization" required onChange={handleChange} />
        <TextField name="field" label="Field" required onChange={handleChange} />
        <TextField name="eligibility.age" label="Eligibility Age" onChange={handleChange} />
        <TextField name="eligibility.year" label="Eligibility Year" onChange={handleChange} />
        <FormControl>
          <InputLabel>Type</InputLabel>
          <Select name="type" onChange={handleChange}>
            <MenuItem value="Internship">Internship</MenuItem>
            <MenuItem value="Research">Research</MenuItem>
            {/* Add more types as needed */}
          </Select>
        </FormControl>
        <TextField name="cost" label="Cost" onChange={handleChange} />
        <TextField name="location" label="Location" onChange={handleChange} />
        <FormControl>
          <InputLabel>Virtual</InputLabel>
          <Select name="virtual" required onChange={handleChange}>
            <MenuItem value={true}>Yes</MenuItem>
            <MenuItem value={false}>No</MenuItem>
          </Select>
        </FormControl>
        <TextField name="startDate" label="Start Date" type="date" required onChange={handleChange} />
        <TextField name="endDate" label="End Date" type="date" onChange={handleChange} />
        <TextField name="website" label="Website" required onChange={handleChange} />
        <TextField name="applicationDeadline" label="Application Deadline" type="date" onChange={handleChange} />
        <TextField name="description" label="Description" onChange={handleChange} />
        <Button type="submit" variant="contained" color="primary">
          Add Program
        </Button>
      </Box>
    </form>
  );
};

export default AddProgramForm;
